    salinity and other variables collected from discrete sample and profile observations
    using Alkalinity titrator, CTD and other instruments from the HUDSON in the Davis
    Strait, Labrador Sea and North Atlantic Ocean from 2009-05-17 to 2009-06-01 (NODC
    Accession 0108073)",nt"tracking_summary": {ntt"total": 3,ntt"recent":
    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2015-09-26T19:36:05.900092",nt"name": "dissolved-inorganic-carbon-alkalinity-temperature-salinity-and-other-variables-collected-from-d279e8",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0108073 includes chemical,
    discrete sample, physical and profile data collected from HUDSON in the Davis Strait,
    Labrador Sea and North Atlantic Ocean from 2009-05-17 to 2009-06-01 and retrieved
    during cruise 18HU20090517 (HUD2009-015). These data include ALKALINITY, CHLOROFLUOROCARBON-11
    (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Carbon
    tetrachloride (CCL4), DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC
    PRESSURE, NITRATE, NITRATE + NITRITE CONTENT (CONCENTRATION), PHOSPHATE, Potential
    temperature (theta), SALINITY, SILICATE and WATER TEMPERATURE. The instruments used
    to collect these data include Alkalinity titrator, CTD, Coulometer for DIC measurement
    and bottle. These data were collected by Kumiko Azetsu-Scott and Ross Hendry of
    Bedford Institute of Oceanography as part of the CLIVAR_AR07W_2009 data set.nnThe
    International CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries
    out a systematic and global re-occupation of select WOCE/JGOFS hydrographic sections
    to quantify changes in storage and transport of heat, fresh water, carbon dioxide
